package dev.dworks.apps.ataxer.wizard;import android.content.Context;import dev.dworks.apps.ataxer.wizard.pages.DeductionFourPage;import dev.dworks.apps.ataxer.wizard.pages.DeductionOnePage;import dev.dworks.apps.ataxer.wizard.pages.DeductionThreePage;import dev.dworks.apps.ataxer.wizard.pages.DeductionTwoPage;import dev.dworks.apps.ataxer.wizard.pages.DetailsPage;import dev.dworks.apps.ataxer.wizard.pages.ExemptionPage;import dev.dworks.apps.ataxer.wizard.pages.IncomePage;import dev.dworks.apps.ataxer.wizard.pages.TaxPage;import dev.dworks.apps.ataxer.wizard.pages.TaxReviewPage;import dev.dworks.libs.awizard.model.PageList;import dev.dworks.libs.awizard.model.WizardModel;public class TaxWizardModel extends WizardModel {		public TaxWizardModel(Context paramContext) {		super(paramContext);	}	protected PageList onNewRootPageList() {		DetailsPage detailsPage = new DetailsPage(this, DetailsPage.TITLE);		detailsPage.setRequired(true);				IncomePage incomePage = new IncomePage(this, IncomePage.TITLE);		incomePage.setRequired(true);				ExemptionPage exemptionPage = new ExemptionPage(this, ExemptionPage.TITLE);		exemptionPage.setRequired(true);				DeductionOnePage deductionOnePage = new DeductionOnePage(this, DeductionOnePage.TITLE);		deductionOnePage.setRequired(true);				DeductionTwoPage deductionTwoPage = new DeductionTwoPage(this, DeductionTwoPage.TITLE);		DeductionThreePage deductionThreePage = new DeductionThreePage(this, DeductionThreePage.TITLE);		DeductionFourPage deductionFourPage = new DeductionFourPage(this, DeductionFourPage.TITLE);				TaxReviewPage reviewPage = new TaxReviewPage(this, TaxReviewPage.TITLE);		reviewPage.setRequired(true);		TaxPage taxPage = new TaxPage(this, TaxPage.TITLE);				return new PageList(				detailsPage,				incomePage,				exemptionPage,				deductionOnePage,				deductionTwoPage,				deductionThreePage,				deductionFourPage,				reviewPage,				taxPage);	}}